

DROP TABLE IF EXISTS `t_china_regions`;
CREATE TABLE `t_china_regions` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '县及县以上行政区划代码表',
  `code` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '区域代码',
  `parent_id` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '父级区域代码',
  `name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '区域名称',
  `level` int(1) DEFAULT NULL COMMENT '行政区划等级',
  `status` int(20) DEFAULT '0' COMMENT '开通状态,默认值0:开通，1：不开通',
  PRIMARY KEY (`id`),
  KEY `t_china_regions` (`id`,`code`,`parent_id`,`level`,`status`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3511 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='中国地区表';


